import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import '../App.css';

import { useSelector, useDispatch } from 'react-redux';
import { listPuppies } from '../actions/puppyActions';
import { Jumbotron, Card,  Container, CardDeck, CardGroup,Nav, Col, Row, Tab } from 'react-bootstrap';
import Sold from './Sold';

const PuppiesPage = (props) => {
    const puppyList = useSelector(state => state.puppyList);
    const { puppies, loading, error } = puppyList;
    const dispatch = useDispatch();
    useEffect(() => {
        dispatch(listPuppies());
        return () => {
        };
    }, [])
    return loading? <div>loading...</div>:
    error? <div>{error}</div>:
    <div className="HomeContainer">

<div className="">
<h1>Puppies</h1>



    <div className="">
        <p id="subTitle"> Previously sold Litter </p>
    <div className=""> 
    <Tab.Container id="left-tabs-example" defaultActiveKey="first">
  <Row>
    <Col sm={3}>
      <Nav variant="pills" className="flex-column">
        <Nav.Item>
          <Nav.Link eventKey="first">Avalible Puppies</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="second">Sold Puppies</Nav.Link>
        </Nav.Item>
      </Nav>
    </Col>
    <Col sm={9}>
      <Tab.Content>
        <Tab.Pane eventKey="first">

        </Tab.Pane>
        <Tab.Pane eventKey="second">
        <Sold />
        </Tab.Pane>
      </Tab.Content>
    </Col>
  </Row>
</Tab.Container>

    </div>
    </div>


    </div>
    </div>
}
export default PuppiesPage;
